// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0 <0.8.0;

import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/math/Math.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./JuniorTokenWrapper.sol";
import "./SkyrimToken.sol";

contract JuniorInvestPool is Ownable, JuniorTokenWrapper {
    using SafeMath for uint256;
    using Math for uint256;
    using SafeERC20 for IERC20;
    using SafeERC20 for SkyrimToken;

    SkyrimToken public TRAToken;
    uint256 public constant DURATION = 1 days;

    uint256 public constant startTime = 1604214013; 
    uint256 public periodFinish = 0;
    uint256 public rewardRate = 0;
    uint256 public lastUpdateTime;
    uint256 public rewardPerTokenStored = 0;

    mapping(address => uint256) public userRewardPerTokenPaid; 
    mapping(address => uint256) public rewards; 

    bool private open = true;
    uint256 private constant _gunit = 1e18;

    event RewardAdded(uint256 reward);
    event Staked(address indexed user, uint256 amount);
    event Withdrawn(address indexed user, uint256 amount);
    event RewardPaid(address indexed user, uint256 reward);
    event SetOpen(bool _open);

    modifier updateReward(address account) {
        rewardPerTokenStored = rewardPerToken();
        lastUpdateTime = lastTimeRewardApplicable();
        if (account != address(0)) {
            rewards[account] = earned(account);
            userRewardPerTokenPaid[account] = rewardPerTokenStored;
        }
        _;
    }

    constructor(address JTToken_, address TRAToken_) JuniorTokenWrapper(JTToken_) payable {
        TRAToken = SkyrimToken(TRAToken_);
    }

    function lastTimeRewardApplicable() public view returns (uint256) {
        return periodFinish.min(block.timestamp);
    }

    function rewardPerToken() public view returns (uint256) {
        if (stakeTotal() == 0) {
            return rewardPerTokenStored;
        }
        return
            rewardPerTokenStored.add(
                lastTimeRewardApplicable()
                    .sub(lastUpdateTime)
                    .mul(rewardRate)
                    .mul(_gunit)
                    .div(stakeTotal())
            );
    }

    function earned(address account) public view returns (uint256) {
        return
            stakeAmount(account)
                .mul(rewardPerToken().sub(userRewardPerTokenPaid[account]))
                .div(_gunit)
                .add(rewards[account]);
    }

    function stakeTo(address account, uint256 amount) override public checkOpen checkStart updateReward(msg.sender){ 
        require(amount > 0, "Cannot stake 0");
        super.stakeTo(account, amount);
        emit Staked(account, amount);
    }

    function withdrawTo(address account, uint256 amount) override public checkStart updateReward(account){
        require(amount > 0, "Cannot withdraw 0");
        super.withdrawTo(account, amount);
        emit Withdrawn(account, amount);
    }

    function exitFrom(address account) external {
        withdrawTo(account, stakeAmount(msg.sender));
        getRewardTo(account);
    }

    function getRewardTo(address account) public checkStart updateReward(account){
        uint256 reward = earned(account);
        if (reward > 0) {
            rewards[account] = 0;
            TRAToken.safeTransfer(account, reward);
            emit RewardPaid(account, reward);
        }
    }

    modifier checkStart(){
        require(block.timestamp > startTime,"MASK:Pancakeswap MASK&CAKE pair POOL - Not start");
        _;
    }

    modifier checkOpen() {
        require(open, "MASK:Pancakeswap MASK&CAKE pair POOL - Pool is closed");
        _;
    }

    function getPeriodFinish() external view returns (uint256) {
        return periodFinish;
    }

    function isOpen() external view returns (bool) {
        return open;
    }

    function setOpen(bool _open) external onlyOwner {
        open = _open;
        emit SetOpen(_open);
    }

    function notifyRewardAmount(uint256 reward)
        external
        checkOpen
        updateReward(address(0)){
        if (block.timestamp > startTime){
            if (block.timestamp >= periodFinish) {
                uint256 period = block.timestamp.sub(startTime).div(DURATION).add(1);
                periodFinish = startTime.add(period.mul(DURATION));
                rewardRate = reward.div(periodFinish.sub(block.timestamp));
            } else {
                uint256 remaining = periodFinish.sub(block.timestamp);
                uint256 leftover = remaining.mul(rewardRate);
                rewardRate = reward.add(leftover).div(remaining);
            }
            lastUpdateTime = block.timestamp;
        }else {
          uint256 b = TRAToken.balanceOf(address(this));
          rewardRate = reward.add(b).div(DURATION);
          periodFinish = startTime.add(DURATION);
          lastUpdateTime = startTime;
        }

        TRAToken.mint(address(this),reward);
        emit RewardAdded(reward);

        _checkRewardRate();
    }

    function _checkRewardRate() internal view returns (uint256) {
        return DURATION.mul(rewardRate).mul(_gunit);
    }
}
